    def return_label(self, file_name, colunm):
        idx = self.file_names.index(file_name)
        if self.bearing(colunm) == 1:
            if idx < 700:
                return self.LABELS["Normal"]
            elif 700 <= idx < 950:
                return self.LABELS["Degraded Outer Race"]
            else:
                return self.LABELS["Outer Race Fault"]
        else:
            return self.LABELS["Normal"]

